import React, { Component } from 'react';
import { ModalOpener } from './ModalOpener';
import { TextInput } from '../TextInput';


export class NavegationButton extends Component {
    myForm = () => {
        return (
            <form>
                <a href='www.google.com.ar' />{/*Deberán aparecer los links hacia el resto de las páginas*/}
                <a href='www.google.com.ar' />
                <a href='www.google.com.ar' />
                <a href='www.google.com.ar' />
            </form>
        );
    }

    render() {
        return (
            <ModalOpener buttonText='Navegación' children={this.myForm()} />
        );
    }
}
